import React from 'react'
import photos from '../data'
import styled from 'styled-components'

const Homepage = () => {
	const Wrapper = styled.div`
	border: 2px solid black;
	margin-top: 5%;
	display: flex;
	flex-wrap: wrap;
	`

	const Image = styled.img1
	
	return (
		<Wrapper>
		{photos.map((photo) => (
			<>
			<img src={photo.url} />
			<p>{photo.title}</p>
			</>
		))}
		</Wrapper>

	)
}

export default Homepage
